import string
import re
from collections import namedtuple

TestCase = namedtuple('TestCase', 'case expected')

INPUT = """"""


def check_case(test_case, actual):
    if test_case.expected == actual:
        print("OK %s" % (test_case.case,))
    else:
        print("FAIL %s, expected %s, got %s" % (test_case.case, test_case.expected, actual))


TEST_CASES = [
    TestCase('dabAcCaCBAcCcaDA', 10),
]

REACTIONS = dict(
    list(zip(string.ascii_lowercase, string.ascii_uppercase)) +
    list(zip(string.ascii_uppercase, string.ascii_lowercase))
)

RE_REACT = re.compile('|'.join([c + c.upper() + '|' + c.upper() + c for c in string.ascii_lowercase]))


def solve(input):
    current = input.strip()
    while True:
        next = RE_REACT.sub('', current)
        if len(current) == len(next):
            return len(next)
        current = next


if __name__ == '__main__':
    for case in TEST_CASES:
        result = solve(case.case)
        check_case(case, result)

    print(solve(INPUT))
